var delay = 200;

var curInt = (ctx != null) ? setInterval(draw, delay) : null;

var count = 0;
function draw() {
	ctx.fillStyle = "#000";
	ctx.fillRect(0, 0, 800, 600);
	
	if (screen[0][0].length == 3) {
		for (i = 0; i < screen.length; i++) {
			for (j = 0; j < screen[0].length; j++) {
				ctx.fillStyle = "#"+screen[i][j][0]+screen[i][j][1]+screen[i][j][2];
				ctx.beginPath();
				ctx.arc(25 + 50 * j, 25 + 50 * i, 10, 0, 2 * Math.PI, false);
				ctx.fill();
			}
		}
	} 
	else {
		var f = count % screen.length;
		for (i = 0; i < screen[0].length; i++) {
			for (j = 0; j < screen[0][0].length; j++) {
				ctx.fillStyle = "#"+screen[f][i][j][0]+screen[f][i][j][1]+screen[f][i][j][2];
				ctx.beginPath();
				ctx.arc(25 + 50 * j, 25 + 50 * i, 10, 0, 2 * Math.PI, false);
				ctx.fill();
			}
		}
		count++;
	}
}

function setDesign(design,design_name){
	clearInterval(curInt); 
	screen = design; 
	count = 0; 
	var speed = 0;
	for(var i = 0; i < designs.length; i++){
		if(designs[i].name == design_name){
			speed = designs[i].speed;
		}
	}
	curInt = setInterval(draw, speed);
}

function isNotLastChecked(start){
	for(var i = start + 1; i < designs.length; i++){
		if(document.getElementById(designs[i].name+"_check").checked){
			return true;
		}
	}
	return false;
}

function designsAreChecked(){
	for(var i = 0; i < designs.length; i++){
		if(document.getElementById(designs[i].name+"_check").checked){
			return true;
		}
	}
	return false;
}

function sendToMascotCodeFile(){
	var target = 'mascot_code.html';
	if(designsAreChecked()){
		target += "?designs=[";
	}
	
	for (s = 0; s < designs.length; s++){
		if (document.getElementById(designs[s].name+"_check").checked){
			target += designs[s].name;
			if(isNotLastChecked(s)){
				target += ",";
			}
		}
	}
	
	if(designsAreChecked()){
		target += "]";
	}
	
	window.open(target,'Mascot Code');
}